import React from "react";
import logo from "./logo.svg";
import "./App.css";

let btnIdx = 0;

interface btnProps {
  idx: number;
  text: string;
}

function Btn(props: btnProps) {
  if (btnIdx === props.idx)
    return (
      <div className="d-flex">
        <svg>
          <path
            fill="None"
            stroke="#FFC000"
            strokeWidth="2px"
            width={25}
            d="M 0,0 L 0,36 30,18 Z"
          />
        </svg>
        <p className="App-header-btn App-header-btn-selected">{props.text}</p>
      </div>
    );
  else return <p className="App-header-btn">{props.text}</p>;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p className="App-title">Gym Battles</p>
        <Btn text="Create Session" idx={0} />
        <Btn text="Join Session" idx={1} />
      </header>
    </div>
  );
}

export default App;
